import React from "react";
import "./FollowingCard.css";
import UserProfile from "../User/userProfile";
import { FollowerData } from "../../Data/FollowerData";
import { useEffect } from "react";
import {getAllUser} from '../../redux/action/user'
import { useDispatch, useSelector } from "react-redux";
import { useState } from "react";

const FollowingCard = () => {
  dispatch=useDispatch();
  const {user} = useSelector((state) => state.auth.userData);
  const [Person,setPerson] = useState([]);
  
  useEffect(() => {
  const fetchPerson = async () => {
    const {data} = dispatch(getAllUser());
    setPerson(data);
    console.log(data);
  };
  fetchPerson();
  }, [])
  


  return (
    <div className="FollowingCard">
      <h3>People you may know</h3>

      {FollowerData.map((follower, id) => {
        return (
         <UserProfile follower={follower} id={id}/>
        );
      })}
    </div>
  );
};

export default FollowingCard;
